RandomTest.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.0;
contract RandomTest{
    function randomTest(uint x, uint y, uint z, uint px, uint py) public view returns (uint)
    {      
            // Generate a number from 1 to 100
            uint r = random();

            // r is smaller than px with probability px/100
            if (r <= (px/100))
                return x;

            // r is greater than px and smaller than or equal to px+py
            // with probability py/100
            if (r <= (px+py)/100)
                return y;

            // r is greater than px+py and smaller than or equal to 100
            // with probability pz/100
            else if(r > (px+py)/100)
                return z;
    }

    function random() internal view returns (uint) {
        //Only Returns 0,1,2
    uint randomnumber = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender))) % 3;
    return randomnumber;
    }

}

